import React, { useEffect, useState } from 'react';
import { getFirestore, collection, getDocs } from 'firebase/firestore';
import { initializeApp } from 'firebase/app'; 
import firebaseConfig from './Components/firebaseConfig'; 
import RespostaSimulacao from './Components/RespostaSimulacao';

function Simulacao() {
    const [produtos, setProdutos] = useState([]);
    const [lucroDesejado, setLucroDesejado] = useState('');
    const [pesoMaximo, setPesoMaximo] = useState('');
    const [capacidadeCaminhao, setCapacidadeCaminhao] = useState('');
    const [combinations, setCombinations] = useState([]);

    useEffect(() => {
        const fetchProdutos = async () => {
            try {
                const app = initializeApp(firebaseConfig);
                const db = getFirestore(app);
                const produtosRef = collection(db, 'produtos');
                const produtosSnapshot = await getDocs(produtosRef);
                const produtosData = produtosSnapshot.docs.map(doc => ({
                    id: doc.id,
                    ...doc.data()
                }));
                setProdutos(produtosData);
            } catch (error) {
                console.error('Erro ao buscar os produtos:', error);
            }
        };
        fetchProdutos();
    }, []); 

    const handleGerarPossibilidades = () => {
        const info_products = produtos.map(p => ({
            custo: parseFloat(p.PRECO_FINAL),
            nome: p.Nome,
            peso: parseFloat(p.Peso),
            volume: parseFloat(p.m3)
        }));

        encherCaminhaoComUmProduto(info_products);
    };

    function encherCaminhaoComUmProduto(objts){
        const newCombinations = [];
    
        for (let i = 0; i < objts.length; i++) {
            for (let j = i + 1; j < objts.length; j++) {
                // Combinar o produto atual com todos os produtos restantes
                const produtosCombinados = [objts[i], objts[j]];
                // Adicionar os produtos combinados ao caminhão
                adicionarProdutosAoCaminhao(produtosCombinados);
            }
        }
        
        setCombinations(newCombinations);
    }
    
    function adicionarProdutosAoCaminhao(produtos) {
        let peso_c_atual = 0;
        let volume_c_atual = 0;
        let qtde_produtos = 0;
        let custoTotal = 0;
    
        const lucro_desejado = parseFloat(lucroDesejado).toFixed(2);
        const MaxPeso = parseFloat(pesoMaximo);
        const MaxVol = parseFloat(capacidadeCaminhao);
    
        produtos.forEach((produto) => {
            peso_c_atual += produto.peso;
            volume_c_atual += produto.volume;
            qtde_produtos++;
            custoTotal += produto.custo;
        });
    
        const combinacao = {
            produtos: produtos.map(produto => produto.nome).join(', '),
            volume_t: volume_c_atual.toFixed(),
            peso_t: peso_c_atual.toFixed(2),
            custo_uni: (custoTotal / qtde_produtos).toFixed(2),
            venda_uni: ((custoTotal / qtde_produtos) + ((custoTotal / qtde_produtos) * (lucro_desejado / custoTotal))).toFixed(2),
            lucro_uni: (((custoTotal / qtde_produtos) * (lucro_desejado / custoTotal))).toFixed(2),
            lucro_t: (((custoTotal / qtde_produtos) * (lucro_desejado / custoTotal)) * qtde_produtos).toFixed(2),
            qtde: qtde_produtos 
        };
        
        newCombinations.push(combinacao);
    }
    
    
    return (
        <div className='Simulacao'>
            <h1 className='custom-cursor Simulacao-title'>Simulação De Lucro</h1>
            <div className='PriceWannaWin'>
                <h2>Quanto de lucro deseja ganhar?</h2>
                <input 
                    type='number' 
                    placeholder='Informe o lucro desejado' 
                    value={lucroDesejado}
                    onChange={(e) => setLucroDesejado(e.target.value)}
                />
                <h3>Peso máximo caminhão</h3>
                <input 
                    type='number' 
                    placeholder='Informe o peso máximo'
                    value={pesoMaximo}
                    onChange={(e) => setPesoMaximo(e.target.value)} 
                />
                <h3>Capacidade</h3>
                <input 
                    type='number' 
                    placeholder='Informe a capacidade do caminhão'
                    value={capacidadeCaminhao}
                    onChange={(e) => setCapacidadeCaminhao(e.target.value)} 
                />
                <button onClick={handleGerarPossibilidades}>Gerar Possibilidades</button>
            </div>
            <RespostaSimulacao combinations={combinations} />
        </div>
    );
}

export default Simulacao;
